package slab

import (
	"os"
	"strings"
	"testing"

	"github.com/stretchr/testify/require"
)

func TestParseSlabInfo(t *testing.T) {
	slabs, err := parseSlabInfo(strings.NewReader(slabInfoExample))
	require.NoError(t, err)
	require.Len(t, slabs, 515)

	slab := slabs[2]
	require.Equal(t, "ovl_inode", slab.name)
	require.Equal(t, int64(29*4*os.Getpagesize()), slab.size)
}

